import { useState } from "react";
import style from "./form.module.css"
import { sumbitGame } from "../../redux/actions";

import { useDispatch } from "react-redux";

function Form({ allGenres }) {

  const allPlatforms = ["PC", "xBox", "PS4", "Switch", "PS5"];

  const [isDisabled, setIsDisabled] = useState(false)

  const [data, setData] = useState({
    name: "",
    description: "",
    realesed: "",
    background_image: "",
    rating: "",
    platforms: "",
     genres: ""
  })

  const [errors, setErrors] = useState({
    name: "",
    description: "",
    realesed: "",
    background_image: "",
    rating: "",
    platforms: "",
    genres: "",
  });

  
  const disabledHandler = () =>{
    if(errors){
      setIsDisabled(true)
    }

  }
  
  // const diseableHander = () => {
  //   let disable = true;
  //   for (let error in errors){
  //     if(errors[error] === "") disable = false
  //   }
  //   return disable;
  // }

  function validation(data){
    let errors={}
    
    if(data.name==="" || !data.name) errors.name = "El nombre es obligatorio"
    
    if(data.description===""|| !data.description) errors.description = "Agregue una breve descripcion"
    
    if(data.background_image===""|| !data.background_image) errors.background_image = "La imagen es obligatoria"
    
    if(data.realesed===""|| !data.realesed) errors.realesed = "Ingrese la fecha de lanzamiento"
    
    return errors;
  }

  const handleChange = (event) => {
    setData({
      ...data,
      [event.target.name]: event.target.value
    })
    setErrors(
      validation({
        ...data,
        [event.target.name]: event.target.value
      })
    )
  }
  
  const dispatch = useDispatch();
  
  function handleSumbit(event) {
    event.preventDefault()
    console.log(data)
    dispatch(sumbitGame(data))
  }
  
  return (
    <div className={style.container} >
      <h1>Subi tu juego</h1>


      <form onSubmit={handleSumbit}>
        <label >Nombre</label>
        <input
          type="text"
          value={data.name}
          onChange={handleChange}
          placeholder="Name"
          name="name"
        />
        {errors.name ? <p className="formerror">{errors.name}</p> : null}
        <label >Imagen</label>
        <input
          type="text"
          value={data.background_image}
          onChange={handleChange}
          placeholder="background_image"
          name="background_image"
        />
        <label >Descripcion</label>
        <input
          type="text"
          value={data.description}
          onChange={handleChange}
          placeholder="Description"
          name="description"
        />
        <label >Plataformas</label>
        <select>
          <option value={data.platforms} disabled selected>-</option>
          {
            allPlatforms.map((plat) => (
              <option value={plat}>
                {plat}
              </option>
            ))
            }
        </select>
        <label >Rating</label>
        <input
          type="text"
          value={data.rating}
          onChange={handleChange}
          placeholder="1 to 10"
          name="rating"
        />
        <label >Fecha de lanzamiento</label>
        <input
          type="text"
          value={data.realesed}
          onChange={handleChange}
          placeholder="Realesed date"
          name="realesed"
        />
        <label >Generos</label>
        <select>
          <option value={data.genres} disabled selected>-</option>
          {
            allGenres.map((genero) => (
              <option key={genero.id} value={genero.name}>
                {genero.name}
              </option>
            ))
          }
        </select>
        <button type="submit" onClick={handleSumbit} disabled={disabledHandler}>SUMBITEALO</button>
      </form>
    </div>
  );
}

export default Form;
